            "Name": "Облачные доспехи",
            "Desc": "Холодная и твёрдая чешуя Суаньни-отшельника. Она сохраняет чистую силу Адептов даже после отпадения и не может быть повреждена обычным оружием.<br>Обычные звери иногда попадают под влияние силы Адептов и становятся более могущественными, чем обычно. Однако сила Адептов суаньни исходит изнутри, поэтому их предводителя часто считают равным Адепту.<br>Несмотря на то, что их считают благородными зверьми, существуют почти забытые легенды о нападении на деревни суаньни по имени «хозяйка горы». Считается, что танец Ушоу возник как ритуал, призванный умиротворить это существо. Однако, поскольку суаньни видели очень немногие, проверить эту теорию, естественно, не представляется возможным.",
