            "Desc": "Единственное, что осталось от гидротульпы после рассеивания его частей.<br>Это вещество очень похоже на кристаллы, извлечённые из тел инородов Фонтмера, но содержит множество мелких примесей, как пузырьки в стекле, изготовленном неопытным мастером.<br>Оно выглядит не таким гладкими, как жемчужины инород, а имеет невероятно острые шипы, тянущиеся во все стороны. Однако вместо того, чтобы казаться опасными или агрессивными, эти шипы выглядят так, как будто хотят вырваться из центра кристалла или вытянуться и разлететься во все стороны.",
