            "Name": "Тёмная масса",
            "Desc": "Фрагменты, полученные в результате напряжённой борьбы с Всепожирающим нарвалом.<br>Даже в тёмном ночном небе всегда есть слабые отблески света, как жемчужины, сверкающие в песке, как осколки алмаза, рассыпанные по асфальту, как огни, пробивающиеся сквозь туманную ночь, как искры, зажигающие самые яркие огни.<br>Но смотрите внимательно. Огни постепенно исчезают, и тьма подступает со всех сторон. Вы станете ярким пламенем, новой звездой, освещающей вселенную лишь на короткий миг. Или же вы станете властителем тьмы, которая уничтожит все эти ничтожные искры.",
