            "R": 4,
            "Name": "Рог Фонтмера",
            "Desc": "Морской конёк тысячелетней жемчужины эволюционировал как высший хищник из конька-пузырька. Его эволюционный путь сильно отличался от других инородов Фонтмера: его скелет стал крупнее и сильнее, чем у исходного вида, он обзавёлся конечностями, рогами и даже изменил кости и мышцы, которых не было у конька-пузырька. Его манера больше напоминает фантастических зверей из древних легенд, чем форму его прародителя. В воображении поэтов и писателей даже морские коньки могли резвиться на земле.<br>Согласно легендам Фонтейна, было два вождя первобытных инородов Фонтмера, которые долгое время соперничали друг с другом. Один из тиранов намного превзошёл всех своих соплеменников и в конце концов основал в пещере отдельное королевство, которое принадлежало только ему.",
