            "_id": 113052,
            "R": 4,
            "Name": "Турбийон",
            "Desc": "Механическая деталь точной обработки, нейтрализующая действие силы тяжести и вращающаяся с высокой скоростью, которую практически невозможно определить невооруженным глазом.<br>На протяжении всей своей долгой истории Научно-исследовательский институт кинетической энергии Фонтейна искал способ противостоять потопу, который когда-то смыл бесчисленное множество жизней и однажды может обрушиться вновь.<br>Архиум, содержащий огромный запас энергии и способный разрушить земные оковы, когда-то считался ключом к вратам спасения. Хотя экспериментальные устройства, созданные на основе этой руды, не дали желаемого результата, жители Фонтейна очень давно начали сами проводить исследования в этой области, но они закончились ничем. Эта руда способна разделять материю и некоторые иные элементы.",
