            "Name": "Запасная деталь чудного механизма: Коппелиус",
            "Desc": "Запасная деталь мека для Коппелиуса, который обеспечивает энергией механического танцора.<br>Отбивая ногой платиновые звуки, механический танцор и днём и ночью погружал зрителя в круговорот танца ледяного ветра. Коппелиус не прекращал танцевать, пока не прозвенел погребальный колокол.<br>В начальной версии «Заводной Коппелии» Коппелиус был создателем и поклонником механической Коппелии, что в большей степени подтверждается воспоминаниями зрителей, и меньше - выдержками из записанных реплик:<br>«Я принял решение - впредь я больше не стану следовать за теми, кто нравится мне, а буду дарить радость тем, кто выбрал меня».<br>«Пусть это абсурд, но всё же соответствует здравому смыслу. Мудрец всегда слушается приказа глупцов, а вся жизнь человеческая напоминает пошлую комедию».",
