            "R": 4,
            "Name": "Запасная деталь чудного механизма: Коппелия",
            "Desc": "Запасная деталь заводного механизма для Коппелии, которая обеспечивает энергией механического танцора.<br>По задумке создателя утончённый механический танцор должен был замереть в момент радости. Того, кто попытается испортить этот миг, Коппелия отправит на верную гибель с помощью своих безупречных боевых навыков...<br>На создание «Сюиты ледяного ветра» автора вдохновила пьеса «Заводная Коппелия» о том, как один изобретатель страстно желал заполучить заводной механизм: Коппелию с «человеческим сердцем». Эта пьеса была поставлена в оперном театре только один раз, и то лишь её первые несколько актов. Постановку пьесы с нетерпением ждали критики и литературная общественность, но во время антракта после первого акта на премьере произошла чудовищная катастрофа.<br>Всё, что осталось от этой истории, - это строки первых нескольких актов, записанные зрителями, которым посчастливилось присутствовать тогда в театре, а также развалины стен и афиши в старых газетах.<br>С тех пор прошло много лет. В то время оперный театр «Эпиклез» ещё не был построен, а после разрушения театр, в котором всё случилось, никто не купил и не реконструировал. Он переходил из рук в руки много раз, прежде чем стал «Дебор Отель», каким мы его знаем сегодня. Но даже спустя столько лет неоконченная версия «Заводной Коппелии» по-прежнему вдохновляет авторов, которые жаждут писать о «золотой» эпохе или о трагедии (часто эти сюжеты переплетаются), а также инженеров и изобретателей, увлекающихся литературой.",
