            "R": 4,
            "Name": "Песнь отзвука древней струны",
            "Desc": "Материал возвышения оружия.<br>В той великой катастрофе золотой дворец утонул вместе с престолом, музыка разбилась вдребезги, ноты превратились в тишину...<br>Но выжившие жители той империи никогда не отказывались от своего стремления спастись и превзойти судьбу.<br>Дабы сберечь свою угасающую цивилизацию и давнюю мечту о трансцендентности, «Золотая труппа» исполняла чарующие мелодии, завлекая детей, чтобы они отдали свои драгоценные души спящим големам.",
